switch (msg.payload.type) {
    case 'INBOUND':
    case 'OUTBOUND':
        msg.force = 'mute';
        return msg;
    case 'MISSED':
    case 'DISCONNECT':
    case 'UNREACHED':
        msg.force = 'unmute';
        return msg;
}

return null;
